.border{
     width: 100%;
     height:95vh;
     background-color:  rgb(8, 15, 62);
     display: flex;
    flex-direction: row;

}
.div_any_title{
    background-image: url('./images/边框.png') ;
    background-size: 100% 100%;
    border-radius: 18px;
    position: absolute;
    top:20px;
    height: 60px;
    width: 84%;
    top:10px;
    left: 9%;
    line-height: 52px;
    text-align: center;
    font-size: 1.9rem;
    font-family: MicrosoftYaHei;
    font-weight: bold;
    color: #00FFFF;
}
#left {
    margin-left: 1%;
    width: 30%;
    height:30%;
    margin-top:60px;
    margin-right:12px;

}
.border_center {
    width: 55%;
    margin-left:50px;
    border: 0px solid #185FAE;
    border-radius:10px;
    box-sizing: border-box;
    position: relative;
    box-shadow: -8px 0px 10px #034c6a inset,
    8px 0px 10px #034c6a inset;
    height: 700px;
    padding-top:100px;
}
.border_right {
    width: 35%;
    margin-left:50px;
    border: 0px solid #185FAE;
    border-radius:10px;
    box-sizing: border-box;
    position: relative;
    box-shadow: -8px 0px 10px #034c6a inset,
    8px 0px 10px #034c6a inset;
    height: 700px;
    padding-top:100px;
}
.border-div2 {
    border: 4px solid #185FAE;
    border-radius:12px;
    width: 100%;
    min-height: 350px;
    margin-top: 100px;
    margin-bottom: 32px;
    position: relative;
}
